import React, { useState, useEffect } from 'react'
import Recipe from './takeFullRecipe'
function RecipesCards(res) {
    const [cards, setCards] = useState([" "])
    useEffect(() => {
        setCards(res.data);
        console.log(cards)
    })

    return (
        <div className='popular'>
            <div id='Card' className="row row-cols-2 row-cols-md-3 g-3 m-5">
                {
                    cards ? cards.map(cards =>
                        <div className="ard-header" key={cards.id}>
                            <div className="card" >
                                <img src={cards.image} className="card-img-top" alt="first Recipe" />
                                <div className="card-body">
                                    <h5 className="card-title">{cards.title}</h5>
                                    <button onClick={()=>{<Recipe data={cards.id} />}}>See the instruction for theis recipe recipe</button>
                                </div>
                            </div>
                        </div>)
                        : console.log("error")
                }
            </div>
        </div>
    )

}
export default RecipesCards
